import React, { Component } from 'react'
import { Link } from "react-router-dom";

class NavBarContainer extends Component {
  render() {
    return (
      <div>
        <div>
      <Link to="/campuses">Campuses</Link> 
      <br/>
      <Link to="/students">Students</Link>
    </div>
      </div>
    )
  }
}

export default NavBarContainer;
